insert  into `es_brand`(`brand_id`,`name`,`logo`,`keywords`,`brief`,`url`,`disabled`,`ordernum`) values (1,'旺旺','http://static.v4.javamall.com.cn/attachment/brand/201202211150124684.jpg',NULL,'<p>\n	旺旺之业务可追溯至台湾宜兰食品工业股份有限公司。旺旺于1992年正式投资大陆市场，是台湾第一个在大陆注册商标并且拥有最多注册商标的公司，于1994年在湖南设立第一家工厂，旺旺秉持着&ldquo;缘、自信、大团结&rdquo;的经营理念，立志成为&ldquo;综合消费食品王国&rdquo;，向着&ldquo;中国第一，世界第一&rdquo;的目标不断前进。</p>\n','http://www.wantwant.com.cn/',0,0),(2,'新农哥','http://static.v4.javamall.com.cn/attachment/brand/201202211143461491.jpg',NULL,'','http://http://xinnongge.o-sa.info',0,0),(3,'洽洽','http://static.v4.javamall.com.cn/attachment/brand/201202211146563596.jpg',NULL,'<p>\n	洽洽食品股份有限公司成立于2001年8月9日，位于合肥市国家级经济技术开发区，主要生产坚果炒货类、焙烤类和薯片类等休闲食品。洽洽食品（002557）于2011年3月2日在深圳交易所挂牌上市。2011年6月1日，洽洽食品启动品牌新形象&ldquo;更时尚、更快乐&rdquo;。</p>\n<p>\n	洽洽食品坚持以&ldquo;创造美味产品，传播快乐味道&rdquo;为使命，经过近十多年的发展，产品线日趋丰富，成功推广&ldquo;洽洽香瓜子&rdquo;、洽洽喀吱脆&rdquo;、&ldquo;洽洽小而 香&rdquo;、&ldquo;洽洽怪U味&rdquo;等产品，深受消费者的喜爱，品牌知名度和美誉度不断提升，是中国坚果炒货行业的领军品牌，产品远销国内外30多个国家和地区。</p>\n','http://www.qiaqiafood.com',0,0),(4,'百味林','http://static.v4.javamall.com.cn/attachment/brand/201202211152387107.gif',NULL,'<p style=\"color: rgb(102, 102, 102); line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\n	<strong>上海百味林实业有限公司</strong></p>\n<p style=\"color: rgb(102, 102, 102); line-height: 18px; margin: 5px 0px; padding: 0px;\">\n	上海总部地址：上海市嘉定区马陆镇丰功路801号百味林大厦</p>\n<p style=\"color: rgb(102, 102, 102); line-height: 18px; margin: 5px 0px; padding: 0px;\">\n	上海总部电话：021-31273838</p>\n<p style=\"color: rgb(102, 102, 102); line-height: 18px; margin: 5px 0px; padding: 0px;\">\n	电子商务部电话：400-110-3001</p>\n<p style=\"color: rgb(102, 102, 102); line-height: 18px; margin: 5px 0px; padding: 0px;\">\n	传真：021-63739210</p>\n','http://www.bwlfood.com/',0,0),(5,'乐事','http://static.v4.javamall.com.cn/attachment/brand/201202211154567239.jpg',NULL,'','http://www.lays.com.cn/',0,0),(6,'上好佳','http://static.v4.javamall.com.cn/attachment/brand/201202211156220232.gif',NULL,'<p>\n	上好佳控股有限公司由施恭旗董事长领导，作为一个企业家，他从亚洲地区小企业家们敢做敢为寻求财富的精神中汲取灵感、受到鼓舞。上好佳公司以享有这种精神的亚洲企业而感到自豪。</p>\n','http://www.oishi-tm.com/',0,0),(7,'天喔','http://static.v4.javamall.com.cn/attachment/brand/201202211200113292.jpg',NULL,'<p>\n	上海天喔食品（集团）有限公司是一家以蜜饯、炒货、南北货、麦片生产为主，其他休闲食品生产为辅的著名食品生产企业。成立于1999年12月，总投资 11320.75万港元，注册资本8490.75万港元，为沪港合资。公司地处上海市松江区泗泾镇，总占地面积65亩。生产车间完全参照标准药品洁净厂房 要求设计修建。设施先进，环境优美，年均产值过亿元。</p>\n','http://www.tenwowfood.com',0,0),(8,'金帝','http://static.v4.javamall.com.cn/attachment/brand/201202221015047090.jpg',NULL,'<p>\n	<font size=\"-1\">源自欧洲，由瑞士<em>巧克力</em>大师亲自调制。多年来，严格坚持欧洲甄选标准,精心挑选上乘&ldquo;黄金可可&rdquo;，造就了至浓可可味的经典<em>巧克力</em></font></p>\n','http://www.leconte.com.cn/',0,0),(9,'好时','http://static.v4.javamall.com.cn/attachment/brand/201202221018146247.gif',NULL,'','http://www.hersheys.com',0,0),(10,'瑞士莲','http://static.v4.javamall.com.cn/attachment/brand/201202221035341549.gif',NULL,'','http://www.lindtusa.com',0,0),(11,'德芙','http://static.v4.javamall.com.cn/attachment/brand/201202221036549178.jpg',NULL,'','http://www.dovechocolate.com.cn/',0,0),(12,'可口可乐','http://static.v4.javamall.com.cn/attachment/brand/201202221038391096.jpg',NULL,'','http://www.coca-cola.com',0,0),(13,'百事','http://static.v4.javamall.com.cn/attachment/brand/201202221040322598.jpg',NULL,'','http://www.pepsi.com',0,0),(14,'农夫山泉','http://static.v4.javamall.com.cn/attachment/brand/201202221042275274.jpg',NULL,'','http://www.nfsq.com.cn/app/appOut.action',0,0),(15,'五粮液','http://static.v4.javamall.com.cn/attachment/brand/201202221044295459.jpg',NULL,'<p>\n	五粮液集团有限公司前身是50年代初8家古传酿酒作坊联合组建而成的&ldquo;中国专卖公司四川省宜宾酒厂&rdquo;，1959年正式命名为&ldquo;宜宾五粮液酒厂&rdquo;，1998年改制为&ldquo;四川省宜宾五粮液集团有限公司&rdquo;。</p>\n','http://www.wuliangye.com.cn/',0,0),(16,'阿尔卑斯','http://static.v4.javamall.com.cn/attachment/brand/201202221654250514.jpg',NULL,'<p>\n	<font size=\"-1\"><em>阿尔卑斯</em>全球最大的糖果生产企业之一，专业从事各种糖果和胶姆糖的生产和销售。其中比较有代表性的就是<em>阿尔卑斯</em