o;标本兼治&rdquo;理念，正是相宜本草养肤之道的来由。 因为，女人的美，从来都是由内而外。 即使外表平凡， 强大的内在力量亦让美丽绽放； 倘若丽质天生，内在力量更令你魅力加分。 肌肤更是如此，强韧的肌肤能量，内在的活力和健康，才是肌肤真正的美丽源泉。</p>\n','http://www.inoherb.com/',0,0),(57,'Mentholatum/曼秀雷敦','http://static.v4.javamall.com.cn/attachment/brand/201202231018171140.png',NULL,'','http://www.mentholatum.com.cn/',0,0),(58,'Herborist/佰草集','http://static.v4.javamall.com.cn/attachment/brand/201202231020005541.gif',NULL,'<p style=\" padding-left:20px;\">\n	受千年本草美颜文化启迪，中国第一套具有完整意义的中草药护理品牌&mdash;&mdash;佰草集于1998年清新诞生。糅合中国美颜经典与现代生物科技，以本草古方配伍为特色，佰草集逐步实现着中国文化中追求&ldquo;自然、平衡&rdquo;的亘美境界，缔造了一个本草养美颜的传奇。</p>\n<p style=\" padding-left:20px;\">\n	采天地灵气，化气韵和谐，佰草集萃取自中国经典草药精华，提出以&ldquo;证&rdquo;、&ldquo;方&rdquo;、&ldquo;效&rdquo;为核心的严谨的理论体系：以中医理论辩肌肤问题之证，以现代科技焕活传世古方，以内在调养之法达到养护肌肤之效，开启中草药养美的全新风尚。</p>\n<p style=\"padding-left: 20px;\">\n	享受自然的绿色馈赠，更将绿色之美还给自然,佰草集自创立以来，一直倡导绿色环保的品牌理念，提出&ldquo;养出地球之美&rdquo;的绿色时尚宣言。现在，佰草集更走出国门，以其独特的中国文化底蕴和全新品牌形象在法国以及其他国际市场中引领中医养美潮流，与全球分享&ldquo;美自根源养有方&rdquo;的佰草集养美之理念！</p>\n','http://www.herborist.com.cn/',0,0),(59,'海飞丝','http://static.v4.javamall.com.cn/attachment/brand/201202231146497650.jpg',NULL,'','http://scalptrends.ellechina.com/',0,0),(60,'潘婷','http://static.v4.javamall.com.cn/attachment/brand/201202231147529126.gif',NULL,'','http://www.pantene.com.cn/',0,0),(61,'飘柔','http://static.v4.javamall.com.cn/attachment/brand/201202231149270759.jpg',NULL,'','http://www.pg.com.cn/',0,0),(62,'多美滋',NULL,NULL,'','http://1000day.dumex.com.cn/',0,0),(63,'美赞臣','http://static.v4.javamall.com.cn/attachment/brand/201202231159446345.jpg',NULL,'','http://www.meadjohnson.com.cn/',0,0),(64,'光明',NULL,NULL,'','http://www.brightdairy.com/',0,0),(65,'雅培',NULL,NULL,'','http://www.abbottmama.com.cn/',0,0),(66,'Nestle/雀巢','http://static.v4.javamall.com.cn/attachment/brand/201202231204385546.jpg',NULL,'','http://www.nestle.com.cn/',0,0),(67,'妈咪宝贝',NULL,NULL,'','http://www.unicharm.com.cn/',0,0),(68,'帮宝适',NULL,NULL,'','http://goldensleep.pampers.com.cn/',0,0),(69,'Johnson/强生',NULL,NULL,'','http:/