n/attachment/goods/201202221448193992.jpg'),(11,'百味林开心果(彩)200G','0000112436',4,6,1,0,NULL,'200.00',1,NULL,'<p>\n	<font color=\"#800000\" face=\"黑体\" size=\"4\"><strong><font color=\"#000000\" face=\"Arial\" size=\"3\" style=\"background-color: #c0c0c0\">&nbsp;</font>商品介绍</strong></font>&nbsp; <font color=\"#c0c0c0\" size=\"4\">Product</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">百味林开心果采用优质的开心果为原料，果实自然开口，颗颗饱满，容易剥壳，开心果仁酥脆香口，是老少咸宜的休闲食品之一。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">开心果小知识：开心果，又名必思答，绿仁果等。传说五世纪时的波希战争中，波斯人英勇无比，在恶劣的环境中愈战愈勇，最终打败了希腊人，其&ldquo;秘密武器&rdquo;就是士兵们吃了一种神奇的干果&mdash;&mdash;开心果。因此，古代波斯国国王将开心果视为&ldquo;仙果&rdquo;。开心果也被称为是&ldquo;美国花生&rdquo;。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">1.开心果果仁是高营养的食品，每100果仁含维生素A20微克，叶酸59微克，含铁3毫克，含磷440毫克，含钾970毫克，含钠270毫克，含钙120毫克，同时还含有烟酸、泛���、矿物质等。种仁含油率高达45.1％。<br />\n	<br />\n	2.开心果中含有丰富的油脂，因此有润肠通便的作用，有助于机体排毒。<br />\n	<br />\n	3.开心果又是滋补食药，它味甘无毒，温肾暖脾，补益虚损，调中顺气，能治疗神经衰弱、浮肿、贫血、营养不良、慢性泻痢等症。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\"><strong>小提示：</strong></font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">开心果富含精氨酸，它不仅可以缓解动脉硬化的发生，有助于降低血脂，还能降低心脏病发作危险，降低胆固醇，缓解急性精神压力反应等。</font></p>\n<p>\n	<font color=\"#800000\" face=\"黑体\" size=\"4\"><strong><font color=\"#000000\" face=\"Arial\" size=\"3\" style=\"background-color: #c0c0c0\">&nbsp;</font>品牌介绍</strong></font>&nbsp; <font color=\"#c0c0c0\" size=\"4\">Brand</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">作为领先的休闲食品打造专家，我们始终坚持为您及家人提供优质的产品和专业的服务。为确保产品 更安全、更健康，我们严格的执行了各项食品生产标准，让您尽享生活的醇和满足。您所喜爱的百味林更是&ldquo;上海市著名商标&rdquo;&ldquo;上海名牌产品&rdquo;&ldquo;上海快速消费品 畅销金品&rdquo;&ldquo;上海消费满意产品&rdquo;送礼尊贵大方，让您体面过人！优质生活，轻松品味！快乐食品&mdash;&mdash;百味林。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\"><strong>温馨提示:</strong></font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">由于部分商品包装更换较为频繁，因此您收到的货物有可能与图片不完全一致，请您以收到的商品实物为准，同时我们会尽量做到及时更新，由此给您带来不便请多多谅解，谢谢！</font></p>\n','22.00','224.00','32.00','[{\"name\":\"规格参数\",\"paramList\":[{\"name\":\"规格\",\"value\":\"\",\"valueList\":[]},{\"name\":\"重量\",\"value\":\"200g\",