L,NULL,'1','中国',0,0,0,NULL,0,'','','',''),(29,'瑞士莲 经典排装提子果仁牛奶巧克力100g','0000389413',10,10,5,0,NULL,'100.00',1,NULL,'<div class=\"detail_box\">\n	<p class=\"detail_tit\">\n		<strong>商品特色</strong></p>\n	<p>\n		1、瑞士莲巧克力采用一百七 十多种的巧克力配料制作精致巧克力是一门讲究技巧、专注与激情的艺术。而Lindt瑞士巧克力大师正是这门艺术的艺术家。瑞士莲的优点是幼滑细腻，入口即 溶。这主要依靠Rodolphe Lindt (鲁道夫&bull;莲)在1879年独特创新发明的&ldquo;巧克力研拌工艺&rdquo;。它的主要原理：研拌器是一个载有木或金属珠的容器，能发挥研磨作用。内里物料被研磨及混合 之余，同时磨擦生热。此研磨过程用以制造巧克力，配料研拌长达78小时。如此长时间的研拌，使得可可与原料混合成幼滑、细致的如丝般绸滑乳状，散发出丰富 的香味，这样才保持了它独有的口感和味道。<br />\n		2、他们从自己种植可可豆开始，坚持不懈的保证自己的品质。巧克力大师们用专业的技术，独特的眼光精选优质的可可豆保持自己产品的独特性。大师们以自己专 业的水准来把关每一个细节。在选择其它配料的时候，他们更注重品质的好坏。很多原料都是他们不远万里从别的国家运自瑞士。如加州的杏仁，产自土耳其的榛子 等等，百年来都是如此的严谨和把关，再加上Lindt瑞士巧克力18位大师的专心研究制作，用制作工艺品的热情和专注，一直延续着Lindt 在世界上的声望，在世界美食之林打造这这个品牌永远优质名誉。</p>\n</div>\n<div class=\"detail_box\">\n	<p class=\"detail_tit\">\n		<strong>品牌介绍</strong></p>\n	<p class=\"p_detail\">\n		瑞士莲,史宾利(Lindt &amp; Sprｕngli)是一个已经传承了六代的瑞士巧克力制造商。这家企业在经历了历史的沧桑变化后，成为19世纪众多优质巧克力创新者中，为数不多的存活下来的家族掌控的瑞士巧克力制造商，从而成为巧克力制造产业中的传奇。</p>\n</div>\n<p>\n	&nbsp;</p>\n','18.80','18.00','24.80','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格\",\"value\":\"100g\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"180天\",\"valueList\":[]},{\"name\":\"储存方法\",\"value\":\"\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":6}]','[{\"cost\":18,\"goodsLvPrices\":[],\"goods_id\":29,\"name\":\"瑞士莲 经典排装提子果仁牛奶巧克力100g\",\"price\":18.8,\"product_id\":29,\"sn\":\"0000389413\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":100}]',NULL,NULL,1329900411,1329900411,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3','中国',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202221645469071_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202221645469071_big.jpg','http://static.v4.