2004年销售收入293亿美元，为全球第四大食品和饮料公司。在2004年公布的《财富》杂志全球500强排名中，百事公司 位列第166位，并于最近连续两年被评为《财富》&ldquo;全球最受赞赏的饮料公司&rdquo;第一名。在2004年《福布斯》杂志&ldquo;全美最有价值公司品牌&rdquo;中百事公司位列 在前十名。2003年8月《商业周刊》评选的全球最有价值品牌的排名中，百事公司旗下的百事可乐品牌排名在第二十三位。百事公司的前身百事可乐公司创建于 1898年。百事可乐公司于1965年与世界休闲食品最大的制造与销售商菲多利（Frito-lay）公司合并，组成了百事公司。为了更好的发挥产品结构 优势，将市场经营重点在核心品牌方面，百事公司曾于1997年10月作出重大战略调整，将拥有必胜客（Pizza Hut）、肯德基（KFC）和Taco Bell的餐厅从公司分离出去，使之成为一家独立的上市公司，即百胜全球公司（Tricon Global，现公司名为YUM！）,这也以便集中精力进行品牌建设和品牌营销。1999年，百事公司将其百事可乐罐装百事公司 （Pepsico.，Inc.）是世界上最成功的消费品公司之一，在全球200多个国家和地区拥有14万雇员，2004年销售收入293亿美元，为全球第 四大食品和饮料公司。<br />\n	　　在2004年公布的《财富》杂志全球500强排名中，百事公司位列第166位，并于最近连续两年被评为《财富》&ldquo;全球最受赞赏的饮料公司&rdquo;第一名。在 2004年《福布斯》杂志&ldquo;全美最有价值公司品牌&rdquo;中百事公司位列在前十名。2003年8月《商业周刊》评选的全球最有价值品牌的排名中，百事公司旗下的 百事可乐品牌排名在第二十三位。百事公司的前身百事可乐公司创建于1898年。百事可乐公司于1965年与世界休闲食品最大的制造与销售商菲多利 （Frito-lay）公司合并，组成了百事公司。在将非战略性业务剥离的同时，百事公司也陆续收购或者并购了多项核心业务.1998年，百事公司与世界 鲜榨果汁行业排名第一的纯品康纳公司（Tropicana Products Inc.）合并。2000年，百事公司将以制造水果混合型饮料、能量饮料、乳品饮料、茶饮料和含有植物成分的SoBe饮料业务纳入公司业务范围，并开拓一 系列新型饮料产品。2001年，百事公司获得美国联邦贸易委员会无条件批准，以134亿美元成功收购世界著名的桂格（Quaker Oats Company）公司，一跃成为全球非碳酸饮料行业的冠军。合并后的百事公司，重点发展需求强劲的休闲食品和饮料业务。负责美国和加拿大以外近200个市 场业务的&ldquo;百事国际集团&ldquo;（PepsiCo International），领导百事旗下食品和饮料业务在北美以外市场的开发。<br />\n	　　该企业在《巴伦周刊》公布的2006年度全球100家大公司受尊重度排行榜中名列第六!<br />\n	　　1898年8月28日，是百事可乐&ldquo;Pepsi-Cola&rdquo;攠诞生的日子。这是每一个关爱百事可乐的人们都引以为骄傲且不会忘却的日子。<br />\n	　　一百多年来，百事可乐在喧嚣、纷乱、竞争的氛围中，随着时代的步伐，与美国和世界一起成长、壮大。如同一个&ldquo;哇、哇&rdquo;坠落于人世的幼小生命，百事可乐 在经历了无数次与命运、病痛、磨难、灾难的抗争，甚至跌倒在死亡线上的挣扎之后，昂首挺胸地步入了人生最为绚丽的青春年华，迎来了生机昂然的春天。在广阔 的全球饮料市场上，百事可乐后来居上，终于与先于其12年问世的可口可乐并驾齐驱、鼎分天下。<br />\n	　　基本成分有碳酸水（水，二氧化碳），白沙糖，焦糖色，磷酸，咖啡因，食用香料。<br />\n	　　百事可乐 (Pepsi Cola) 是美国百事公司推出的一种碳酸饮料，也是可口可乐的主要竞争对手。在全球的可乐市场中，可口可乐均占上风，但在加拿大的魁北克省，该处的百事可乐销量却比 可口可乐高，是少数能超越可口可乐的地区。在那里，不少说法语的人均惯饮百事，透过法语明星做代言人，百事在当地的市场地位得以把持。在二十世纪中期，百 事的名称曾是当地的英语人贬低法</font></p>\n','11.20','10.00','15.00','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"330ml*6罐 \",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"罐\",\"valueList\":[]},{\"name\":\"产地\"