模、产量、销售收入��利润、利税等指标上已连续10年位居中国饮料行业首位，成为目前 中国最大、效益最好、最具发展潜力的食品饮料企业。</p>\n','2.80','2.30','3.40','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"产地\",\"value\":\"中国\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"365天\",\"valueList\":[]},{\"name\":\"储存方法\",\"value\":\"存放于阴凉干爽处，避免阳光直射\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"开启即饮\",\"valueList\":[]},{\"name\":\"配料\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":5}]','[{\"cost\":2.3,\"goodsLvPrices\":[],\"goods_id\":37,\"name\":\"娃哈哈 蓝莓绿茶500ml/瓶\",\"price\":2.8,\"product_id\":37,\"sn\":\"0015668710\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":500}]',NULL,NULL,1329907093,1329907093,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','0',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202221837311683_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202221837311683_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202221837311683_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202221837311683.jpg'),(38,'统一 冰红茶 250ml*24/箱','0010008012',24,15,10,0,NULL,'250.00',1,NULL,'<p>\n	<font face=\"宋体\"><font size=\"3\"><font color=\"#800000\"><strong><font color=\"#000000\" face=\"Arial\" style=\"background-color: #c0c0c0\">&nbsp;</font>商品特色</strong></font>&nbsp; <font color=\"#c0c0c0\">Product</font></font></font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">统一冰系列是以冰红茶为主要品牌的系列调味茶产品。其中，统一冰红茶是统一企 业在中国饮料市场开始取得竞争优势的代表品牌， 1995 年 6 月首先在华东地区上市 ，从 1998 年开始成为同品类中的领先品牌。统一冰系列一贯坚持 &ldquo; 年轻无极限 &rdquo; 的品牌主张，根据其下三个口味的特性提 出 &ldquo; 畅快无极限 &rdquo; 、 &ldquo; 自然无极限 &rdquo; 、 &ldquo; 沁凉无极限 &rdquo; 三个品牌细分方向。</font></p>\n<p>\n	<font face=\"宋体\"><font size=\"3\"><font color=\"#800000\"><strong><font color=\"#000000\" face=\"Arial\" style=\"background-color: #c0c0c0\">&nbsp;</font>品牌介绍</strong></font>&nbsp; <font color=\"#c0c0c0\">Brand</font></font></font></p>\n<p>\n	<font face=\"宋体