 face=\"Arial\" size=\"3\" style=\"background-color: #c0c0c0\">&nbsp;</font>商品介绍</strong></font>&nbsp; <font color=\"#c0c0c0\" size=\"4\">Product</font></p>\n<p>\n	<span style=\"font-size: 10.5pt; font-family: 宋体\"><font size=\"2\">规格：250ml/盒</font></span></p>\n<p>\n	<span style=\"font-size: 10.5pt; font-family: 宋体\"><font size=\"2\">保质期：365天</font></span></p>\n<p>\n	<span style=\"font-size: 10.5pt; font-family: 宋体\"><font size=\"2\">产地;中国</font></span></p>\n<p>\n	<font face=\"宋体\" size=\"2\">产品描述：果汁富含维生素C和膳食纤维，补充身体每日所需，带来更多舒润滋养，维C靓颜，膳食 纤维轻扬，让心情和味觉一起自信绽放。统一鲜橙多采用PET塑料瓶及TP利乐包各式不同包装，能满足各种不同情境所需，无论于工作闲暇、逛街休闲、家庭聚 会都能享受到统一鲜橙多的甜美滋味。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">配料：水、白砂糖、橙浓缩汁、食品添加剂、食用香精。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">储存方法：请保存于阴凉干燥处，避免阳光直晒，冷藏后饮用，口感更佳。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">注意事项：饮用前请摇匀，开盖后请尽快饮用，冷藏储存，如封口破损，请勿饮用。若有少许沉淀为天然果肉成分，敬请安心饮用</font><font face=\"宋体\" size=\"2\">。</font></p>\n<p>\n	<font color=\"#800000\" face=\"黑体\" size=\"4\"><strong><font color=\"#000000\" face=\"Arial\" size=\"3\" style=\"background-color: #c0c0c0\">&nbsp;</font>品牌介绍</strong></font>&nbsp; <font color=\"#c0c0c0\" size=\"4\">Brand</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">&nbsp; 统一企业自从创业以来，即遵循企业创始人吴修齐先生所秉持之「三好一公道」的经营理念，以多角经营、宏观眼光、重视人才等方针，兢兢业业地塑造出「诚实苦 干、创新求进」的立业精神。统一企业公司於1967年成立以来，深感研究发展之重要，最初於工务部内设立研究单位，以饲料配方开发、面粉研发及品管化验为 研究重点。1972年将研究发展独立，成立研究部，并设立试验课、研究课、服务课等三课，从事面粉、饲料、油脂、速食面、乳品、饮料等产品之开发研究，并 於1987年扩编为三研究部。中央研究所於1991年成立，公司大量投资R&amp;D经费，并扩编研究人力及设备，积极开发全新、机能性、高科技食品， 为迈向全球最大食品公司之一落实技术扎根。1996年於上海昆山市成立大陆综合研究所，并於东南亚如菲律宾、泰国、越南、印尼等分公司成立研究单位，负责 当地产品之开发及品管需求。</font></p>\n<p>\n	<font face=\"宋体\"><font size=\"2\"><strong>温馨提示:</strong><br />\n	由于部分商品包装更换较为频繁，因此您收到的货物有可能与图片不完全一致，请您以收到的商品实物为准，同时我们会尽量做到及时更新，由此给您带来不便请多多谅解，谢谢！</font></font></p>\n','1.20','1.00','1.50','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"250ml/盒\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"盒\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"中国\",\"valueLi