e=\"2\">1837年英国皇室维多利亚女王颁布第一张&ldquo;皇室委任书&rdquo;， 川宁茶被指定为皇室御用茶，并且此殊荣一直被沿袭至今。皇室成员包括女王本人、女王的母亲和查尔斯王子都非常推崇川宁茶。更有幸的是川宁茶曾分别于 1972年和1977年二次获得&ldquo;女王勋章&rdquo;，成为第一家被获准出口的茶公司，从而成功地进入到世界茶文化的市场。<br />\n	现今，川宁茶已风靡全世界100多个国家，更多的人享受着饮茶的乐趣。川宁茶不仅有传统的红茶和绿茶系列，更有果茶、花茶和冰茶等系列特别适合年轻一代的口味。这些新潮的茶系列也体现出全世界人们正趋向追求更健康更多姿的生活方式。 </font></p>\n','42.90','40.00','45.90','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"100g\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"盒\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"英国\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"1095天\",\"valueList\":[]},{\"name\":\"储藏方法\",\"value\":\"存放于阴凉干爽处，避免阳光直射\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"固态\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"每杯放一个茶包，用100℃开水，浸泡3-4分钟即可\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"红茶\",\"valueList\":[]}],\"paramNum\":8}]','[{\"cost\":40,\"goodsLvPrices\":[],\"goods_id\":72,\"name\":\"川宁 英国早餐茶2g*50/盒\",\"price\":42.9,\"product_id\":72,\"sn\":\"0000365275\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":2}]',NULL,NULL,1329918551,1329918551,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'英国',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202222147117661_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222147117661_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222147117661_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222147117661.jpg'),(73,'川宁 豪门伯爵茶2g*50/盒','0000365311',40,28,18,0,NULL,'2.00',1,NULL,'<p>\n	<font color=\"#800000\" face=\"黑体\" size=\"4\"><strong>品牌介绍</strong></font>&nbsp; <font color=\"#c0c0c0\" size=\"4\">Brand</font></p>\n<p>\n	<font color=\"#000000\" face=\"宋体\" size=\"2\">自1706年诞生以来，川宁茶一直屹立在茶市场的最前沿，并引领着饮茶文化的新潮流。在全世界爱好茶文化的人眼中，川宁茶就是饮茶的代表。<br />\n	&nbsp;1837年英国皇室维多利亚女王颁布第一张&ldquo;皇室委任书&rdquo;，川宁茶被指定为皇室御用茶，并且此殊荣一直被沿袭至今。皇室成员包括女王本人、女王的母亲和 查尔斯王子都非常推崇川宁茶。更有幸的是川宁茶曾分别于1972年和1977年二次获得&ldquo;女王勋章&rdquo;，成为第一家被获准出口的茶公司，从而成功地进入到世 界茶文化的市场。<br />\n	&nbsp;1840年，贝德福德第七任女公爵Anna一次无心插柳的茶点时间，引发了在贵族社交圈内蔚为风尚，名媛仕女趋之若鹜的下午茶生活方式。时至今日，在英 国的大饭店、大百货公司里，必有下午茶时光，时间从午后两点左右开始，可持续到五点钟左右。英式下午茶为时尚社交圈带来精神的放松和愉悦，&ldquo;享受&rdquo;应该是 最贴切不过的比喻。极品红茶，茶具都是高级的骨瓷茶具、银质小茶匙和成套的奶罐、糖罐，精致的三层点心提篮，小点心则从甜的SCONE到咸的 sandwich。你可以想像Hotel Ritz的大堂内，穿着考究的女士们饮着红茶，为SCONE抹上果酱的倩影，在这个聚会的公众场合从容的展示她们的品位与魅力。<br />\n	&nbsp;在全世界赏茶人的眼中，川宁茶就是英伦下午茶的代表。300多年来，川宁力臻完美，川宁的专业调茶大师不断调配出令人激动的全新口味，并配合独特的饮用方法，展现了纯正的英伦茶的世界，它极致的品质与绝佳的口感，让英国皇室及全球茶迷深深感动，无限回味。<br />\n	&nbsp;如今，英伦风潮下午茶已然成为了时尚生活的象征，无论是Lady gaga的茶杯造型，还是Kate Moss热衷的私人品茶派对。时尚人士、艺术家、音乐人无数的潮人风向标都指向那一杯温润的下午茶。然而300多年来，面对时代变迁、潮流更替，能出现在 英国皇室贵族茶桌上的始终惟有TWININGS川宁茶。 </font></p>\n','42.90','40.00','43.60','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"100g\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"盒\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"英国\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"1095天\",\"valueList\":[]},{\"name\":\"储藏方法\",\"value\":\"	存放于阴凉干爽处，避免阳光直射\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"固态\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"每杯放一个茶包，用100℃开水，浸泡3-4分钟即可\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"红茶\",\"valueList\":[]}],\"paramNum\":8}]','[{\"cost\":40,\"goodsLvPrices\":[],\"goods_id\":73,\"name\":\"川宁 豪门伯爵茶2g*50/盒\",\"price\":42.9,\"product_id\":73,\"sn\":\"0000365311\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":2}]',NULL,NULL,1329918763,1329918763,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'英国',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202222150494993_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222150494993_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222150494993_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222150494993.jpg'),(74,'川宁 豪门伯爵茶200g/盒','0000365322',40,28,18,0,NULL,'200.00',1,NULL,'<p class=\"detail_tit\">\n	品牌介绍</p>\n<p>\n	自1706年诞生以来，川宁茶一直屹立在茶市场的最前沿，并引领着饮茶文化的新潮流。在全世界爱好茶文化的人眼中，川宁茶就是饮茶的代表。<br />\n	1837年英国皇室维多利亚女王颁布第一张皇室委任书，川宁茶被指定为皇室御用茶，并且此殊荣一直被沿袭至今。皇室成员包括女王本人、女王的母亲和查尔斯 王子都非常推崇川宁茶。更有幸的是川宁茶曾分别于1972年和1977年二次获得女王勋章，成为第一家被获准出口的茶公司，从而成功地进入到世界茶文化的 市场。<br />\n	川宁致力于为全球爱茶人士调配上佳口感的茶品，如今已有300多年的历史。从醇厚浓郁、香气四溢的红茶到口感轻盈、清新怡人的绿茶，以及果香诱人、风味独特的花草/花果冲泡饮品，总能找到令您心动的一款。</p>\n','89.00','80.00','99.00','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"200g\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"盒\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"波兰\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"730天\",\"valueList\":[]},{\"name\":\"储藏方法\",\"value\":\"\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"用100℃开水，浸泡3-4分钟即可\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":8}]','[{\"cost\":80,\"goodsLvPrices\":[],\"goods_id\":74,\"name\":\"川宁 豪门伯爵茶200g/盒\",\"price\":89,\"product_id\":74,\"sn\":\"0000365322\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":200}]',NULL,NULL,1329918925,1329918925,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'波兰',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202222153495831_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222153495831_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222153495831_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222153495831.jpg'),(75,'AKBAR 金牌锡兰红茶50g/盒','0017010514',39,28,18,0,NULL,'50.00',1,NULL,'<div class=\"detail_box\">\n	<p class=\"detail_tit\">\n		商品特色</p>\n	<p class=\"p_detail\">\n		絕對頂尖錫蘭茶，全部選用高海拔的最好的錫蘭茶葉來進行加工和生產，茶味純正，茶色澄淨，毫無雜質的口感和視覺會讓你充分領略到品茶的樂趣。而真正的品茶者也将从其浓浓的茶味，醇醇的回味中，体会制茶人对该系列茶的特别的偏爱。</p>\n</div>\n<p>\n	&nbsp;</p>\n','22.90','22.00','24.90','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"50g\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"斯里兰卡\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"1095天\",\"valueList\":[]},{\"name\":\"储藏方法\",\"value\":\"存放于阴凉干爽处，避免阳光直射\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":8}]','[{\"cost\":22,\"goodsLvPrices\":[],\"goods_id\":75,\"name\":\"AKBAR 金牌锡兰红茶50g/盒\",\"price\":22.9,\"product_id\":75,\"sn\":\"0017010514\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":50}]',NULL,NULL,1329919105,1329919105,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'斯里兰卡',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202222156509029_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222156509029_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222156509029_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222156509029.jpg'),(76,'玛勃洛可 伯爵红茶 20g（10*2g）','0009979297',38,28,18,0,NULL,'20.00',1,NULL,'<p>\n	<font size=\"3\"><font color=\"#800000\" face=\"黑体\"><strong>品牌介绍</strong></font>&nbsp; <font color=\"#c0c0c0\">Brand</font></font></p>\n<p>\n	&nbsp;</p>\n<p>\n	<font face=\"宋体\" size=\"2\">功效：红茶使人的手脚发热，手足发凉的时候可以饮用红茶！</font></p>\n<p>\n	&nbsp;</p>\n<p>\n	<font face=\"宋体\" size=\"2\">MABROC是世界著名的锡兰茶品牌，由斯里兰卡玛勃洛可公司出品。其实一般所熟知的&quot;锡兰红 茶&quot;只是一个统称，泛指锡兰既斯里兰卡地区所产的红茶，只有100%斯里兰卡生产的茶叶才能称之为锡兰红茶，目前市场上许多红茶也宣称为锡兰红茶，实际上 拼配了印度，肯尼亚等产区的红，茶在斯里兰卡高原地区，按照茶叶生长的海拔高度大致分为三大类，海拔600米以下为低海拔茶，海拔600米至1200米为 中海拔茶，海拔1200米以上为高海拔茶叶。我们日全食出售的玛勃洛可红茶，可是真正的高海拔茶哦~~是上海兰珠国际贸易有限公司总代理的斯里兰卡玛勃洛 可（MABROC）公司出品的系列红茶。海拔越高，产量越低，泡出来的茶色泽稍显淡雅，但口味香浓馥郁。玛勃洛可（MABROC）红茶包括多个品种，除诺 瑞莉雅（NUWARAELIYA）外还有伯爵红茶、西伯利亚红茶、大吉岭红茶、亚拉之夜红茶等。还有易于冲泡袋泡茶，口感相当纯正，加奶或柠檬，别有一种 风味，也与城市生活节律相适应。当然，为了丰富红茶的口味，玛勃洛可（MABROC）公司还研制出一千零一夜花果茶、茉莉花茶、草莓红茶、卷曲绿茶、夏威 夷果茶、蒸青薄荷绿茶等，特别是专门为中国消息者度身定制了食蟹后喝的姜红茶，让我们感到一份来自异域的温暖。为了放松疲惫的身心，为了更和谐地交流商务 信息，为了形成小空间的良好人际关系&hellip;&hellip;或许很多人自己早已养成了这个习惯。于是，在红茶溢出的浓郁芬芳里，在一碟香脆的曲奇衬托下，下午4点过后，极具 人情味的tea－time涨满了轻软的笑声。于是，斯里兰卡红茶来到了中国，来到了上海。对于斯里兰卡，上海的老茶客是不陌生的，从小就喝过&ldquo;锡兰红茶&rdquo; 的人也不少。</font></p>\n','6.90','6.00','12.80','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"20g（10*2g）\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"3年\",\"valueList\":[]},{\"name\":\"储藏方法\",\"value\":\"存放于阴凉干爽处，避免阳光直射\",\"valueList\":[]},{\"name\":\"商品形态\",\"value\":\"固态\",\"valueList\":[]},{\"name\":\"食用方法\",\"value\":\"冲饮\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"锡兰高地红茶、黑醋栗碎片、葵花、玉蜀、橙皮，葵花、伯爵香料。\",\"valueList\":[]}],\"paramNum\":8}]','[{\"cost\":6,\"goodsLvPrices\":[],\"goods_id\":76,\"name\":\"玛勃洛可 伯爵红茶 20g（10*2g）\",\"price\":6.9,\"product_id\":76,\"sn\":\"0009979297\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":20}]',NULL,NULL,1329919301,1329919301,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202222159504400_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222159504400_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222159504400_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202222159504400.jpg'),(77,'AkBAR 柠檬绿茶2g*25/盒','0000037945',39,29,18,0,NULL,'2.00',1,NULL,'<p class=\"detail_tit\">\n	商品特色</p>\n<p>\n	清新绿茶配合果味、花香，茶味更芬芳，韵味更悠远。无论何时来一杯，立即给你好心情。</p>\n<p>\n	茶是那些讲究细节并喜欢蒙蒙细雨的人们的饮品，人们可以通过它来进行交流并得到放松。AKBAR系列极品英式红茶，可以满足人们对于精致闲适生活的浪漫追求，品饮之间，弥漫馥郁的贵族气息，诱惑在味道之外，生命因优雅而生动，高贵不言而喻。</p>\n','19.60','18.00','25.00','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格(重量)\",\"value\":\"2g*25\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"盒\",\"valueList\"