宜本草与上海中医药大学基础医学院长期合作，创立本草护肤研究中心。通过研究大量养颜古方秘方，不断探索发现本草护肤养颜的独到功效。历经十年致力于本 草护肤品的研究，独创肌芯养肤科技将汉方本草和现代科技相结合，开发出一系列功效卓著，使用安全本草护肤品。以内在力，外在美为核心的本草养肤之道，正是 由此诞生。肌芯养肤科技&rdquo;能让肌肤内在重获健康，不再依赖外在的修饰和维持，自然、主动、持久地筑起肌肤外在的美丽。相宜本草让肌肤之美从此生生不息。</font></font></p>\n','20.00','18.00','23.80','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格\",\"value\":\"120g\",\"valueList\":[]},{\"name\":\"上架时间\",\"value\":\"2010-01-27\",\"valueList\":[]},{\"name\":\"保质期\",\"value\":\"三年\",\"valueList\":[]},{\"name\":\"产地\",\"value\":\"中国\",\"valueList\":[]},{\"name\":\"成分\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":5}]','[{\"cost\":18,\"goodsLvPrices\":[],\"goods_id\":127,\"name\":\"相宜本草 男士洁面乳120g/支\",\"price\":20,\"product_id\":127,\"sn\":\"0000575100\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":120}]',NULL,NULL,1329994782,1329994782,0,0,0,100,100,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'洁面',0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202231858455491_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202231858455491_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202231858455491_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202231858455491.jpg'),(128,'资生堂吾诺黑炭强力劲爽洁面膏130g ','0000200157',52,48,26,0,NULL,'130.00',1,NULL,'<div class=\"detail_box\">\n	<p class=\"detail_tit\">\n		<strong>商品特色</strong></p>\n	<p>\n		<font face=\"宋体\" size=\"2\">1.资生堂吾诺黑炭强力劲爽洁面膏130g 含天然黑炭能充分吸收毛孔里的污垢及过剩油脂。<br />\n		2.小颗粒清洁微粒在深层清洁毛孔的同时溶走老化角质和顽固污垢。<br />\n		3.温和不刺激皮肤。洗后肌肤平滑不觉粘腻，倍感清爽。无香料。</font><br />\n		<font face=\"宋体\" size=\"2\">4.洗后保持肌肤清洁，有效预防粉刺，皂角来源于100%植物无香料。</font></p>\n</div>\n<p class=\"detail_tit\">\n	<strong>品牌介绍</strong></p>\n<p>\n	<font face=\"宋体\" size=\"2\">&nbsp;&nbsp;&nbsp; 资生堂（Shiseido ）日本著名化妆品品牌。取名源自中文《易经》中的&ldquo;至哉坤元，万物资生&rdquo;，资生堂 的涵义为孕育新生命，创造新价值。&ldquo;至哉坤元，万物资生&rdquo;意为&ldquo;赞美大地的美德，她哺育了新的生命，创造了新的价值。&rdquo;这一名称正是资生堂公司形象的反 映，是将东方的