 size=\"2\"><strong>相关参数：</strong><br />\n	&nbsp; 颜色：天绿色<br />\n	&nbsp; 用途：优质竹香炭防螨定型枕，有利于宝宝头部健康周正的定型。<br />\n	&nbsp; 规格：36*24cm<br />\n	&nbsp; 成分：套：100%竹纤维；填充物：竹香炭、蒙稷、荞麦壳、七孔棉<br />\n	&nbsp; 提示：三个月内的宝宝不适宜用枕头</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\"><strong>产品特色：</strong><br />\n	竹纤维枕套：<br />\n	&nbsp; ●&nbsp; 采用纯天然竹纤维，其具有天然防螨、抑菌、抗静电、防湿疹之功效，由于此纤维质地柔软，似&ldquo;绫罗绸缎&rdquo;般光滑，可以降低宝宝头部与枕头的摩擦，有效预防枕秃。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">竹香炭防螨定型枕特点：<br />\n	&nbsp; ●&nbsp; 严格依照人体工程学裁剪设计，同时严格按照婴幼儿的头型精心缝制而成，长期使用，有益于枕出健康周正的头型，是完全适合婴幼儿使用的专业产品。</font></p>\n<p>\n	<font face=\"宋体\" size=\"2\">竹香炭防螨定型枕填充物：<br />\n	&nbsp; ●&nbsp; 竹香炭，竹香炭是天然竹子的化身，源于竹子而又高于竹子，是利用现代科技制造出的新型活性保健产品，其独特的活性能恒久释放负离子（从竹炭中产生的负离子 具有穿透作用，能松弛神经、消除疲劳；在室内，从竹炭中产生的负离子与空气中的颗粒物相撞，使其带电，这些带电的颗粒物容易附着在墙壁、镜面、地板上，达 到净化空气的目的，置身其中，让人感受徜徉于大自然的森林中一般，心神无限舒畅）和发射远红外线（竹炭能产生最适合人体吸收的远红外线波长，能使物体产生 微热，促进人体衰老细胞的活化，加快血液循环，改善人体内环境）；竹香炭多孔的三维结构能有效吸附汗水、口水并释放天然的竹香，闻之令人神清气爽。</font></p>\n','99.00','80.00','126.00','[{\"name\":\"基本参数\",\"paramList\":[{\"name\":\"规格\",\"value\":\"36*24cm\",\"valueList\":[]},{\"name\":\"颜色\",\"value\":\"天绿色\",\"valueList\":[]},{\"name\":\"材质\",\"value\":\"\",\"valueList\":[]},{\"name\":\"重量\",\"value\":\"\",\"valueList\":[]},{\"name\":\"包装\",\"value\":\"\",\"valueList\":[]}],\"paramNum\":5}]','[{\"cost\":80,\"goodsLvPrices\":[],\"goods_id\":224,\"name\":\"喜亲宝竹香炭防螨定型枕36*24cm（天绿色）\",\"price\":99,\"product_id\":224,\"sn\":\"0011012661\",\"specList\":[],\"specs\":\"\",\"specsvIdJson\":\"[]\",\"store\":0,\"weight\":900}]',NULL,NULL,1330090424,1330090424,0,0,0,0,0,0,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL,0,'http://static.v4.javamall.com.cn/attachment/goods/201202242132103413_thumbnail.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202242132103413_big.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202242132103413_small.jpg','http://static.v4.javamall.com.cn/attachment/goods/201202242132103413.jpg'),(225,'