产品的领导品牌。金士顿目前拥有2000多种存储产品，支持个人电脑、服务器、打印机、MP3播放器、数码相机及手机等几乎所有使用存储产品的设备。2010年，金士顿公司营收高达65亿美元。<br />\n	包括位于美国加州芳泉谷的全球总部在内，金士顿在全球拥有4001多名员工，并被美国《财富》杂志评选为&ldquo;最适宜工作的企业&rdquo;。它的尊重、忠诚、弹性、正直和快乐工作的模式，已成为金士顿独特的企业文化。金士顿相信人是企业最重要的资产，每位员工都是企业成功的重要因素，更是金士顿家族不可或缺的一份子。<br />\n	金士顿运营体系遍布全球五大洲，包括代理商、经销商、零售商及OEM客户。同时，金士顿也为半导体厂商和系统OEM商提供代工和供应链管理服务。<br />\n	<br />\n	DataTraveler101 G2采用时尚、实用、亮眼的外型设计，且价格实惠，能够满足消费者对大容量、轻巧便携、使用方便等诸多方面的需求。这款闪存盘采用新潮旋盖式设计，具有更高的功能性且使用简便，根据容量分为不同的缤纷色彩。</p>\n<p>\n	<br />\n	<img src=\"http://g-ec4.images-amazon.com/images/G/28/hardline-asin/20110928-AAIPZ-04.jpg\" /><br />\n	缤纷色彩，炫出个性自我<br />\n	DataTraveler101 G2具有多种缤纷色彩，不但能够快速分辨产品容量，而且还能成为您炫出自我的最佳方式，金属制的旋转盖帽在方便使用之余，也免去了以往盖帽丢失的烦恼，最大限度地保护USB接口。<br />\n	独具特色的Co-Logo服务<br />\n	DataTraveler 101 G2 也是非常实用的营销利器，该产品支持金士顿独具特色的Co-Logo服务，您可以将公司的标志或其他图像印制在闪存盘上，还可以在闪存盘内部预存您指定的内容，使闪存盘成为企业的专属产品。关于Co-Logo服务的更多情况，请参考http://www.kingston.com/china/flash/cologo/。<br />\n	USB 2.0标准接口，即插即用<br />\n	DataTraveler 101 G2采用标准USB 2.0接口，在主流操作系统上无需安装驱动程序，即插即用，为您的生活带来更多方便。该产品在主流操作系统上的兼容性请参考下表。<br />\n	<img src=\"http://g-ec4.images-amazon.com/images/G/28/hardline-asin/20110928-AAIPZ-05.jpg\" /><br />\n	预装方便实用的个人信息中心软件urDrive<br />\n	urDrive是免费预装在多款金士顿DataTraveler系列闪存盘产品中的应用程序，其中包括游戏、娱乐和应用软件等诸多内容，并能够简洁直观地管理、播放闪存盘中存储的照片、视频、音乐等多种文件，将原本被动的存储设备转换为主动的全新体验。<br />\n	<img src=\"http://g-ec4.images-amazon.com/images/G/28/hardline-asin/20110928-AAIPZ-06.jpg\" /><br />\n	全系列多种容量可供选择<br />\n	DataTraveler 101 G2系列产品共有4GB、8GB、16GB和32GB四种容量可供选择，满足您工作、学习以及日常生活中的不同需求，<br />\n	（MP=百万像素，MB=兆字节，GB=千兆字节）<br />\n	1 Megabyte（MB）= 1,000,000字节，1 Gigabyte（GB）= 1,000,000,000字节<br />\n	* 请注意：部分所列容量主要用于格式化和其他功能使用，不能用于数据存储。<br />\n	** 大约的标准JPEG图片数。JPEG文件大小会随着相机机型、具体设置、照片分辨率以及压缩模式设定而有所不同。<br />\n	*** 大约的歌曲数，以4MB/首计算。最后结果视压缩率与实际设备而有所不同。<br />\n	+ 大约的有声读物数，以2小时长度、MP3格式计算。最后结果将视格式及质量而有所不同。<br />\n	++ 大约的影片长度。，以MPEG1格式、1.5Mbps码率计算。最后结果将视视频格式、码率、压缩比等参数而有所不同。<br />\n	+++ 大约的文件数，以1MB的Word/Excel文件或5MB的PowerPoint文件计算。最后结果将视文件大小而有所不同。<br />\n	五年保固，免费技术支持，免除所有后顾之忧<br />\n	金士顿为DataTraveler101 G2产品提供五年保固和免费技术支持服务，消费者如在使用中出现任何问题，都可以直接拨打金士顿技术支持热线800-810-1972获得专家的解答。如果产品出现故障，消费者可联系当地的金士顿授权服务中心，享受保固服务。金士顿全国授权服务中心地址可到官方网站查询（http://www.kingston.com/china/support/center/network.htm）。<br />\n	<br />\n	<img src=\"http://g-ec4.images-amazon.com/images/G/28/hardline-asin/20110928-AAIPZ-07.jpg\" /><br />\n	为保护消费者权益，免受假货的困扰，金士顿官方提供了多达四种的产品防伪方法：<br />\n	1、拨打金士顿正品维权热线800（400）-820-7655，会有专业客服为您解答防伪方面的问题，并协助您辨别产品真伪。<br />\n	2、通过手机发送产品序列号到0212 333 0345，通过回复的短信辨别产品真伪。查找产品序列号等相关信息请参考金士顿官方网站：http://www.kingston.com/china/verifysms/<br />\n	3、访问金士顿官方&ldquo;一分钟辨真伪&rdquo;网站，输入产品序列号等各项信息，即可准确辨别产品真伪，详情请参考：http://kingston.com/china/verify/default.asp<br />\n	4、访问Kingston Blog的&ldquo;火眼金睛&rdquo;版块，并按要求上传产品的清晰照片，由金士顿的专家们为您准确辨别真伪：http://www.kingstonblog.com.cn/bbs/showforum-32.aspx</p>\n','28.00','0.00','229.00','[{\"name\":\"基本信息\",\"paramList\":[{\"name\":\"商品尺寸\",\"value\":\"5.7 x 1.7 x 1 cm \",\"valueList\":[]},{\"name\":\"商品重量\",\"value\":\"18g\",\"valueList\":[]}],\"paramNum\":2}]','[{\"cost\":0,\"goodsLvPrices\":[],\"goods_id\":257,\"name\":\"Kingston 金士顿 DataTraveler 101 G2 优盘\",\"price\":28,\"product_id\":257,\"sn\":\"G201204090346213395-1\",\"specList\":[{\"spec_id\":1,\"spec_image\":\"\",\"spec_order\":0,\"spec_type\":0,\"spec_value\":\"\",\"spec_value_id\":42},{\"spec_id\":3,\"spec_image\":\"\",\"spec_order\":0,\"spec_type\":0,\"spec_value\":\"\",\"spec_value_id\":60}],\"specs\":\"绿色、4GB\",\"specsvIdJson\":\"[42,60]\",\"store\":0,\"weight\":0},{\"cost\":0,\"goodsLvPrices\":[],\"goods_id\":257,\"name\":\"Kingston 金士顿 DataTraveler 101 G2 优盘\",\"price\":39,\"product_id\":258,\"sn\":\"G201204090346213395-2\",\"specList\":[{\"spec_id\":1,\"spec_image\":\"\",\"spec_order\":0,\"spec_type\":0,\"spec_value\":\"\",\"spec_value_id\":42},{\"spec_id\":3,\"spec_image\":\"\",\"spec_order\":0,\"spec_type\":0,\"spec_value\":\"\",\"spec_value_id\":61}],\"specs\":\"绿色、8GB\",\"specsvIdJson\":\"[42,61]\",\"store\":0,\"weight\":0},{\"cost\":0,\"goodsLvPrices\":[],\"goods_id\":257,\"n