/*Table structure for table `es_repair` */

DROP TABLE IF EXISTS `es_repair`;

CREATE TABLE `es_repair` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '报修id',
  `member_id` int(8) NOT NULL COMMENT '用户id',
  `repair_type` int(1) NOT NULL COMMENT '1为公报，2为私报',
  `category_id` int(11) NOT NULL COMMENT '报修类目id',
  `category2_id` int(11) NOT NULL,
  `title` varchar(15) NOT NULL COMMENT '报修标题',
  `content` varchar(255) NOT NULL COMMENT '报修内容',
  `img_1` varchar(255) DEFAULT NULL COMMENT '报修第一张图片',
  `img_2` varchar(255) DEFAULT NULL COMMENT '报修第二张图片',
  `img_3` varchar(255) DEFAULT NULL COMMENT '报修第三张图片',
  `address` varchar(255) NOT NULL COMMENT '报修地址',
  `update_date` bigint(20) NOT NULL COMMENT '报修更新日期',
  `scheduled_date` bigint(20) NOT NULL COMMENT '报修预约日期',
  `paymoney` decimal(20,2) DEFAULT NULL COMMENT '支付金额，公共报修为0',
  `payment_status` int(1) NOT NULL COMMENT '支付状态 0未支付，1已支付',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '维修状态，1订单待处理，2客服已确认订单，3客服已经派出相关服务人员，4维修服务完成',
  `comment` varchar(200) DEFAULT NULL COMMENT '维修评论',
  `comment_status` int(1) NOT NULL DEFAULT '0' COMMENT '评论状态 0未评论，1已经评论， 默认0',
  PRIMARY KEY (`id`)
